<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Non primitive Data Type</title>
</head>
<body>






    <script>
        var A = {
            name : "This is Object",age : 30,city :"Kolkata", // Object Data Type
        }

        var place = ["Kolkata","Delhi","Mumbai","Chennai","Bengalore"] // array data type
        document.write(A.name);
        document.write(place);
    </script>
</body>
</html>
